REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I ordered this flashlight a few months ago. Now I can surely say that Acme Corp sells high-quality goods for travelers. I took it to Egypt, India, and Peru, and the battery is still alive!Incredible!',75,3465);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('The flashlight seems to be rather a cheap Chinese-made toy. Mine was broken after I dropped it down  from my porch. Very disappointing.',76,3465);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Nice piece of gear. I always use them when my neighbors are having a party or are listening to Miley Cyrus.\r\n',77,1766);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I am a guitar player at post-death-black-thrash-metal band. These earplugs are really helpful at a loud gig. Now I can turn up my amplifier without any danger for my ears and brains:)\r\n',78,1766);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I live next to Ludwig and he presented me another pair of earplugs for Christmas so that I could sleep when he is practicing and rehearsing. Now I do not have to sleep with two pillows on my ears:)',79,1766);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I like the durability of this case. It reminds me of the Little Red Riding Hood fairy tale my mom read me when I was a kid. It also protects my player quite well - I dropped it a few times, and it looks mint new anyway.\r\n',80,3466);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Red is my favorite color. Santa gave it to me last Christmas, but I lost it (as well as my iPod) when I was cycling. I am so happy they offer it here. I have just ordered it from Sailtechno.',81,3466);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Ordered an iPod and this case from Sailtechno as a birthday present for my mother. She is fond of jogging and she is always very careful with her things. The delivery was just in time and all the products were of top-notch quality.',82,3466);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I am a hardcore overclocker and PC mod enthusiast. I bought this light for my next project. Hope that I will make my box look like the Enterprise spaceship from Star Trek:)\r\n',83,3467);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I returned this item as it was not in working condition. I will never buy any crap like this anymore. I’d better have a Mac with no need for such “improvements”.\r\n',84,3467);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Simply cool thing. My black box now looks very futuristic and somehow … mysterious:) Thanks to the guys from Acme! Great job:)',85,3467);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('This photo frame was a good anniversary present for my Granny. I uploaded lots of our family photos in it. She put it next to her TV set in the living room. She is very happy with it!',86,3468);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I got the photo frame on Father’s Day from my kids. It’s rather sentimental, but I always have it with me on my business trips. It evokes good memories and keeps me pacified.',87,3468);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I love taking pictures, and this photo frame is an ideal thing to demonstrate them to my guests. The screen could be brighter, but it’s OK for the price:)',88,3468);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Funny toy. Nice for playing “spy” games with my kids. Rather robust and suitable for boys. The sound quality is acceptable. The vendor was very nice and added some batteries as a present.\r\n',89,978);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('It was a strange birthday present from my friends. Now, we take these pieces when we go fishing. It works better than a cell phone:)',90,978);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Mine was broken by the delivery service, unfortunately. The Monsters provided a replacement, though.',91,978);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Nice quality and cheap as dirt. We use it everywhere in our office. Sometimes I even find these adhesive notes on a chessboard or a tea-pot in our relax room!',92,3469);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I use sticky notes for my lecture books and I always have a spare block when I work in the library. The product has really revolutionized the lecturers’ workflow.',93,3469);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('These adhesive notes are perfect for creating hypertext, adding remarks and so on. Great tool for screenplay writers!',94,3469);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('You can fix almost anything with these adhesive tapes. I have ordered a huge crate from Umbrella and put it in my garage. Probably, my grandchildren will also use it:)',95,3470);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I always purchase various office appliances from Umbrella. My father uses scotch to attach lots of things (like electric cords) in our bungalow. The adhesion to be reliable enough to survive an earthquake or a tornado.',96,3470);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Umbrella’s service seems to be quite disappointing. I had to wait for the delivery for 2 (!) days. The office appliances are good enough, but such a delivery time is unacceptable!',97,3470);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('This fridge is a great bang for your buck, especially if you have a big family. There is enough space for anything you wish to have for a snack or for a great Thanksgiving party.\r\n',98,2508);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Fantastic value! Now I can buy even more FOOD! Each meal is much bigger now!',99,2508);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('The fridge I got from Mitch and Dawson was broken:( I returned it and got a replacement in a day! Thank you, guys!:)\r\n',100,2508);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Excellent customer service from point of order to delivery. This was the very best experience I have ever had when ordering a large appliance on line - from a call immediately after placing the order (on a Sunday) to confirm everything to delivery.',101,2472);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Excellent. Ordered online, was contacted via phone and informed of slight delay due to stock shortage. Received the goods shortly after.\r\n',102,2472);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I wasn\'t sure at first as I had never ordered from ElectricalDiscountUK before. I called customer services about the delivery date as I needed the appliances to be delivered before a certain date or I would have been left with no fridge or freezer. They managed to get them to me on time. I was gifting my old ones to my son and he could only pick up on the day the new ones were due to arrive. Big bonus, I also saved money as they had the best price. I had shopped around for weeks previously before deciding to buy.',103,2472);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('This kettle is wonderful, very sturdy and suitable for tea parties. The design is great too. Thanks to the delivery staff!:)',104,2438);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I have been a customer of Mitch & Dawson for 3 years already, and any piece I purchased from them was a good value for the money. The sales managers are very helpful, the packaging is good and I often get some nice bonus inside (this time I got a pack of 100 tea bags:).',105,2438);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I have just received this kettle and I am quite happy with it. I sit and drink my tea!:)',106,2438);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Our large family is fond of tea parties, so we often need more than one kettle.  My husband ordered this kettle last Sunday and on Monday morning we already had it in our kitchen. Thanks a lot to the delivery staff!:)',107,2438);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('My girlfriend gave me this toothbrush as a birthday present. I would not say that my previous one was a bad one, but this one is much better. My smile became much shinier:)',108,683);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Nice device. It does not take too much space in my suitcase so it is very convenient to take it on a business trip. Thanks for quick delivery.',109,683);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Have been using these toothbrush heads for about a year already. My dentist recommended them for better tooth care. And, well, he was right - it really help me to improve the state of my teeth.',110,683);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('It’s a good all-around piece of equipment. I can carry almost everything I have at home ( a kettle, a frying pan, an alarm clock, a toothbrush and a couple of blankets) when I go camping. Now I am ready for any unexpected journeys!',111,3776);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I am a professional speleologist/digger and I have to spend lots of time in various holes, caves tunnel, etc. This backpack is very compact and water-resistant. It withstands rough conditions of the underworld very well.\r\n',112,3776);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I ordered this backpack for my recent expedition in Morocco. It proved to be extremely durable and capacious. The zippers are very reliable. I received the backpack two hours before leaving for the airport. It was rather careless of me to order it only a day before the departure, but the guys from Mitch and Dawson were lightning fast. Thank you guys!:)\r\n',113,3776);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('It’s an amazing piece of gear! Now I can go jogging with my phone in a back pocket and I still have all the required information at my fingertips anytime.',114,3777);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I find that my training has become less effective because of the Apple Watch. It’s just distracting me and does not improve my concentration. The quality is good, but it is not a must-have device for those who go in for sports professionally. I gave it to my wife.',115,3777);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('These watch help to monitor the condition of my organism during my jogging and has lots of useful and amusing features. The quality is top-notch and I will surely order another piece from you guys!:)',116,3777);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('A new X-Box is there! I pre-ordered it from this vendor and I am very happy with it. Tons of interesting games and performance is amazing. Even a top gaming PC cannot rival with it.',117,3775);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I expected the console to be more powerful and to have much more exclusive games. Still, it is a good choice if you want to keep your kids away from your desktop with important information:)\r\n',118,3775);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Super value! I got it as a Christmas present from my Daddy and I am verry happy with it!:)))',119,3775);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('The hoverboard I ordered was just awesome. Thank you so much!',120,1);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Good service. I\'ve already bought some stuff here twice and I\'ll be back...',121,1);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('Oh… my… God! Your website is great. Thank you so much, I\'m very pleased with the order.',122,1);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('My parcel was damaged. Oh! There isn’t enough camomile tea in the world to quell the rage in my heart.',123,1);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('You\'re awesome, guys! Everything you do is great.',124,3791);
REPLACE INTO ?:discussion_messages (`message`, `post_id`, `thread_id`) VALUES ('I would recommend your company to my friends and business associates. The rating would be a 10',125,3791);
